import React, { useState } from "react";
import EmbedSDK from '@mongodb-js/charts-embed-dom';
 
export default function Moisture() {

    

    const Child = React.forwardRef((props, ref) => {
        return <div ref={ref} id="charts">Child1</div>
    });

 // This following section will display the form that takes the input from the user.
 // Put HTML here
    const child = React.createRef();
 
 return (
     <div>
        <Child ref={child} />

        <script>

        {
            function myFunction() {
            
            const EmbedSDK = window.EmbedSDK;
        
            const sdk = new EmbedSDK({ baseUrl: "https://charts.mongodb.com/charts-dripdatabase-tkohi", showAttribution: false });
            const chart = sdk.createChart({ chartId: "8fae5196-bd76-4776-b6b0-ae7931086753" });
        
            chart.render(document.getElementById('chart'));
            }
        }

        </script>
        
     </div> 
 );
}
